import Navmenuitems from "../components/nav-menu.js";
import Hero from "../components/hero.js";
import aimg from "../assests/12-e8cd6909.jpg";
const Home=()=>{
  return( <>
      <Navmenuitems/>
      <Hero clsName="hero"
            aimg={aimg} btn="Travel Plan"par="Choose Your Favourite Destination" sp="Your Story Your Journey"/>

      </>);
}
export default Home;
